Wood Cremation Urn - Walnut Book with Celtic Cross
This urn is made from the finest solid hardwoods and is designed to look like a book. The walnut is designed to look like the book cover and the lighter area between the walnut is laser etched to look like pages. The center artistry is created by laser cuts and engravings. The Celtic cross artistry is made of solid hardwood and assembled into the hardwood urn with an outside border. Made in the USA Each urn is individually hand crafted by a skilled wood crafter in the United States. Dimensions 8½” W x 3¾” D x 11¼ H Capacity 200 cubic inches Availability » Each urn is custom made for the client upon ordering and typically takes 1-3 business days to ship;
